import React from 'react';
import './Navbar.css'; // Import your navbar styles

function Navbar() {
  return (
    <nav>
      <h2 className="logo">Seb's</h2>
      <ul>
        <li><a href="/" className="nav-link" aria-current="page">Home</a></li>
        <li><a href="/" className="nav-link">Booking</a></li>
        <li><a href="/" className="nav-link">Menu</a></li>
        <li><a href="/" className="nav-link">About us</a></li>
      </ul>
    </nav>
  )
}
export default Navbar;
